import '../components/css/post.css';

const Spaces=()=>{
    const [spaces, setSpaces] = React.useState([]);

    React.useEffect(() => {
      fetch("/getspaces")
        .then((res) => res.json())
        .then((data) => setSpaces(data.spaces));
    }, []);
    console.log(spaces);
    return(
        <div>
           {
               spaces.map(space=>{
                   return(<div key={space._id}>
                    
                   </div>);
               })
           } 
        </div>
    )
   
}
export default Spaces;
